const Carte = () => {
   const [profil, setProfil] = useState([]);


    return (
      <div className='carte'>
      {profil.map((val) => {
        return ( 
            <div className="descri" key={val.id}>
              <img src={`http://localhost:5005/${val.image}`}alt="tete"/>
              <div className="name">{val.name}</div>
              <div className="gabarit">{val.gabarit}{val.type}</div>
              <div className="age">{val.age}</div>
              </div>
          );
        })}
      </div>
)}

export default Carte;
